import React, { Component, Fragment } from 'react'

 class AddContact extends Component {
    render() {
        return (
            <Fragment>

                <div className="container">
                    <h3> Add Contact </h3>
                    <div class="card">
                        <div class="card-body">
                            <h4 class="card-title">Title</h4>
                            <p class="card-text">Text</p>
                        </div>
                    </div>
                </div>
            </Fragment>
        )
    }
}

export default AddContact;
